import {
  ChartBarIcon,
  CogIcon,
  InformationCircleIcon,
} from '@heroicons/react/outline'
import { GAME_TITLE } from '../../constants/strings'
import CSS from 'csstype';
type Props = {
  setIsInfoModalOpen: (value: boolean) => void
  setIsStatsModalOpen: (value: boolean) => void
  setIsSettingsModalOpen: (value: boolean) => void
}

let theme = localStorage.getItem('theme');
console.log(theme)
let element = document.getElementsByClassName('right') as HTMLCollectionOf<HTMLElement>;
console.log(element)
function invert(){
  if (element.length !== 0) {
    element[1].style.filter = "invert(1)";
    }
}

  if (theme === 'dark') {
invert();

  }

  const h1Styles = {
   filter: 'invert(1)'
  };




  export function Heading({ title } : { title: string} ) {
    return <h1 style={h1Styles}>{title}</h1>;
  }




export const Navbar = ({
  setIsInfoModalOpen,
  setIsStatsModalOpen,
  setIsSettingsModalOpen,
}: Props) => { 
  return (
    <div className="navbar">
      <div className="navbar-content px-5">
        <InformationCircleIcon
          className="h-6 w-6 mr-2 cursor-pointer dark:stroke-white"
          onClick={() => setIsInfoModalOpen(true)}
        />
           <img
          className="left"
          alt="logo first"
          src="https://www.firstinspires.org/sites/default/files/uploads/resource_library/brand/thumbnails/FIRST-Icon.png"
          onClick={() =>  window.open("https://www.firstinspires.org/")}
        />
          <img
          className="right"
          alt="logo first"
          src="https://www.firstinspires.org/sites/default/files/uploads/resource_library/brand/thumbnails/FIRST-Wordmark.png"
          onClick={() =>  window.open("https://www.firstinspires.org/")}
        />
        <p className="text-xl ml-2.5 font-bold dark:text-white">{GAME_TITLE}</p>
        <div className="right-icons">
          <ChartBarIcon
            className="h-6 w-6 mr-3 cursor-pointer dark:stroke-white"
            onClick={() => setIsStatsModalOpen(true)}
          />
          <CogIcon
            className="h-6 w-6 cursor-pointer dark:stroke-white"
            onClick={() => setIsSettingsModalOpen(true)}
          />
        </div>
      </div>
      <hr></hr>
    </div>
  )
}
